                labels[i].AutoSize = true;
                labels[i].Font = new System.Drawing.Font("Segoe UI", 10F);
                labels[i].Location = new System.Drawing.Point(labelX, y + (i * spacing));
                labels[i].Text = labelTexts[i];
            }

            System.Windows.Forms.Control[] textboxes = {
        txtHoTen, txtGioiTinh, dtpNgaySinh, txtEmail, txtSDT, txtDiaChi,
        txtQueQuan, txtTonGiao, txtHocLuc, txtHocPhi, txtTrangThai, txtLop
